    data: |
      SELECT DISTINCT - MIN ( - - 89 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q10653.out
    data: |
      -89
